#include <iostream>
#include <string>
using namespace std;
int main()
{
    string a, b;
    getline(cin, a);
    getline(cin, b);
    for (int i = 0; i < b.size(); i++)
    {
        if (a.find(b[i]) != string::npos)
        {
            a.erase(a.find(b[i]), 1);
        }
    }
    if (a.size() == 0)
    {
        cout << "-";
    }
    else
    {
        cout << a;
    }
    return 0;
}
