#include<string>
using namespace std;
int main()
{
    string a,b;
    cin>>a>>b;
    int i=0,j=0;
    while(i<a.length()&&j<b.length())
    {
        if(a[i]==b[j])
        {
            i++;
            j++;
        }
        else
        {
            j++;
        }
    }
    if(i==a.length())
    {
        cout<<"-";
    }
    else
    {
        for(int k=i;k<a.length();k++)
        {
            cout<<a[k];
        }
    }
    return 0;
}



















































































































































































































































































































































































































































































































































































































































































